import React from 'react';
import './App.css';

const App = () => {
  return (
    <div>
      <header>
        <img src='./../public/karman.png'></img>
      </header>
      <nav>
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
      </nav>
      <div>
        Main content
      </div>
    </div>
  );
}
export default App;
